def solve(num):
    even_mult = 1
    odd_mult = 1
    num = str(num)
    for i in range(len(num)):
        if i % 2 == 0:
            even_mult *= int(num[i])
        else:
            odd_mult *= int(num[i])
    if even_mult == odd_mult:
        return True
    else:
        return False

